import { makeObservable, observable, action } from "mobx"

export class Square {
    type = 0

    constructor(type = 0) {
        makeObservable(this, {
            type: observable,
            getType: action,
            changeType: action
        })
        this.type = type
    }

    get getType() {
        return this.type
    }

    changeType(type) {
        this.type = type
    }
}

